import React,{Component} from 'react';
import {
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './login';
import Register from './register';
import Accounts from './Account';
import './App.css';
import 'tachyons';

class App extends Component {
  constructor(){
    super();
  }
  render(){
      return (
      <div className="App">
            <ul>
          <li>
            <Link to="/signin">sign in</Link>
          </li>
          <li>
            <Link to="/signup">sign up</Link>
          </li>
        </ul>
        <Switch>
          <Route path="/signin">
            <Login/>
          </Route>
          <Route path="/signup">
            <Register/>
          </Route>
          <Route path="/users">
            <Register/>
          </Route>
        </Switch>

      </div>
    );
    }
}

export default App;
